      优控云科技是拥有丰富的水处理经验的物联网服务商，在水处理工艺、水务管理运维、自控及互联网行业拥有专家支持团队，专注物联感知、数据挖掘及智慧运维，打造基于物联网大数据的水务精灵SmarTer物联网云服务平台，在工业、市政、未来乡村等领域为环保水处理系统用户提供远程实时呈现、过程数据统计分析、运维动态寻优及后台专家诊断等服务支持。
    </p>
  </div>
